import React from 'react';
import styled from 'styled-components';
import Burger from './Burger';

const NavMobile = styled.nav`
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  z-index: 22;
  height: 84px;
  padding: 0 24px;
  display: flex;
  align-items: center;
  justify-content: space-between;
  background: rgba(251, 248, 242, 0.8);
  border-bottom: 1px solid rgba(24, 29, 47, 0.1);
  backdrop-filter: blur(10px);

  .logo {
    display: flex;
    align-items: center;
  }

  .logo img {
    width: 50px;
    height: 50px;
    border-radius: 16px;
    border: 1px solid rgba(26, 29, 43, 0.14);
    box-shadow: 0 10px 24px rgba(17, 24, 39, 0.12);
    background: #ffffff;
  }

  .menu-web {
    display: flex;
  }

  .menu-mobile {
    display: none;
  }

  @media (max-width: 776px) {
    height: 74px;
    padding: 0 16px;

    .logo {
      margin-right: auto;
      margin-left: 12px;
    }

    .menu-web {
      display: none;
    }

    .menu-mobile {
      display: flex;
    }
  }
`;

const Navbar = () => {
  return (
    <NavMobile>
      <div className="menu-mobile">
        <Burger />
      </div>
      <div className="logo">
        <a href="/"><img src="images/profile.jpg" alt="bitmoji"/></a>
      </div>
      <div className="menu-web">
        <Burger />
      </div>
    </NavMobile>
  );
};

export default Navbar;
